import axios from '@/libs/api.request'

export const getPlayTypeFirstList = (req) => {
    return axios.request({
        url: 'GetList/GetPlayTypeFirst' ,
        method: 'get'
    })
}

export const getPlayTypeSecondList = (req) => {
    return axios.request({
        url: 'GetList/GetPlayTypeSecond' ,
        method: 'get'
    })
}

export const getGetPlayTypeThirdList = (req) => {
    return axios.request({
        url: 'GetList/GetPlayTypeThird' ,
        method: 'get'
    })
}

export const getTeamList = (req) => {
    return axios.request({
        url: 'GetList/GetTeam' ,
        method: 'get'
    })
}
